import React from "react";
import styled from "styled-components";
import img from '../images/bg.jpg'

function Picture() {
	return (
		<BoxPicture pict={img}/>
	)
}

type BoxPicturePropsType = {
	pict: string
}

const BoxPicture = styled.div<BoxPicturePropsType>`
  width: 280px;
  height: 170px;
  margin: 10px 10px 20px 10px;
  border-radius: 10px;
  background-image: image(${props => props.pict});
`
export default Picture;
